import './Search.css';
import React from 'react'
import search from '../../images/search.png'

function Search() {
  return (
    <div className='search-bar'>
        <input className='inside'>
            <img src={search} alt="search icon" />
            <p>Chinese food...</p>
        </input>
    </div>
  )
}

export default Search
